import styled from "styled-components";
import { Link } from 'react-router-dom';
import '../App.css';
import TextField from '@mui/material';


const MainWindow = styled.div`
  width: 500px;
  margin: 0 auto;
  margin-top: 180px;
  background-color: #fa8;
  hr{
    margin: 0 auto;
    width: 95%;
    border: none;
    border-top: 1px solid grey;
  }
`

const SwitchSignIn = styled.div`
  width: 100%;
  height: 60px;
  display: flex;
  align-items: center;
  
  a{
    text-decoration: none;
    color: #787d85;
    text-transform: uppercase;
    letter-spacing: 1px;
    font-size: 11px;
    font-weight: 600;
    margin-left: 40px;
    :hover{
      color: black;
      transition: 1500ms;
    }
  }
`


const MainContainer = styled.div`
  width: 450px;
  margin: 0 auto;
  #headline{
    margin: 30px 0 20px 14px;
    font-size: 24px;
    font-weight: normal;
    color: black;
  }
`

const SignIn = () => {
  return (
    <>
      <p>Ссылка сработала, заебись</p>
      <Link to='/Dashboard'>Домой</Link>
      <MainWindow> 
        <SwitchSignIn>
          <a href="#">Войти</a>
          <a href="#">Создать учётную запись</a>
        </SwitchSignIn>
        <hr/>
        <MainContainer>
          <p id="headline">Войти с помощью вашей учётной записи</p>
        </MainContainer>
      </MainWindow>
    </>
  );
}

export default SignIn;
